DataTable ConvertJsonListToDataTable(string json)
{
    var jObject = JObject.Parse(json);

    var columnDateHeaders = jObject["columnDateHeaders"].ToObject<List<string>>();
    var topTableRowNames = jObject["topTableRowNames"].ToObject<List<string>>();
    var topTableData = jObject["topTableData"].ToObject<List<JObject>>();

    var table = new DataTable();

    table.Columns.Add("Date", typeof(string));

    foreach (var name in topTableRowNames)
    {
        table.Columns.Add(name ?? "Unnamed", typeof(string));
    }

    for (int i = 0; i < columnDateHeaders.Count; i++)
    {
        var newRow = table.NewRow();
        newRow["Date"] = columnDateHeaders[i];

        for (int j = 0; j < topTableData.Count; j++)
        {
            string value = (string)topTableData[j]["row"][i];

            if (value != null && value.Contains("kr."))
            {
                value = value.Replace("kr.", "");
                value = Regex.Replace(value, "[^0-9,]+", "");
                value = value.Replace(',', '.');
            }

            newRow[j + 1] = value;
        }

        table.Rows.Add(newRow);
    }

    return table;
}

